            "title": "Accommodations",
            "description": "<p style=\"text-align: justify;\">Sleeps 12 in 6 staterooms in the Owner's party and 10 in crew including Captain's Cabin.</p> \n<p style=\"text-align: justify;\">The interior of LOON is beautifully finished in light cherry with lacquers and exquisite detail work everywhere. She has an abundance of large deep windows on each deck level, giving her interior great light and an airy comfortable feeling.</p> \n<p style=\"text-align: justify;\"><br /><strong>Master stateroom</strong>: The master stateroom, located forward on the main deck is full beam with the king bed, and is finished in light cherry wood. The remodeled master bathroom has Jacuzzi tub and separate shower. There is a slate floor.<br /><br /><strong>Four Guest staterooms:</strong> The guest accommodation  area opens from the lower deck lobby, with the three of the Lower cabins having convertible king beds that in minutes convert into two twins beds. In a highly practical design the two aft cabins can be united by sliding a partition to create a VIP suite with one queen berth (Stbd Aft) and a convertible King on Port Aft. All guest suites have excellent wardrobe space, and en suite bathrooms finished in Calacatta marble, and individual audio visual centers. A central passageway from the guest stateroom area gives crew access from the laundry area to the guest area for housekeeping duties.</p> \n<p style=\"text-align: justify;\"><br /><strong>Main Deck Cabin:</strong> Located on the main deck amidship to port, and completely refitted in 2018. Located aft of the Owner's suite and ahead of the galley, this cabin is ideal for nanny, staff, or children. It has an oversize queen berth and a full bathroom. It has all medical equipment for emergencies and can be accessed from the main deck foyer.<br /><br /><strong>Dining Room:</strong> The main deck dining room is located aft of the foyer, with a large wood block table seating 10.<br /><br /><strong>Main salon:</strong> With the primary living area being the bridge deck lounge, the main deck salon is an elegantly intimate space with an oversized Couch central and 4 arm chairs arranged around a coffee table. Access out to the aft deck.</p> \n<p style=\"text-align: justify;\"><strong>Aft Deck:</strong> A lovely open aft deck has alfresco dining for 12 with a built in settee and chairs. There is a wet bar to port and storage to starboard. Stairs set to starboard lead down to a large swim platform. Stairs to starboard lead up to the bridge deck. Passarelle access is to port.<br /><br /><strong>Day Bathrooms:</strong> Day bathrooms are located on the main deck and bridge deck levels.<br /><br /><strong>Headroom:</strong> 6'9\" throughout<br /><br /><strong>Sky Lounge:</strong> Sky Lounge: The delightful sky lounge is the yacht's primary relaxation area and primary salon. There is comfortable group seating, a game table aft to port and a Service Bar to starboard. There is a large screen TV built in the forward cabinet.<br /><br /><strong>Aft Bridge Deck:</strong> The outside deck, aft of the bridge deck sky lounge/ main salon area is arranged with chairs around coffee tables and is entirely shaded from the sun by the sundeck overhead above.<br /><br /><strong>Bridge Cabin:</strong> Extremely spacious the Bridge cabin has a queen berth and is located on the bridge deck with ensuite bathroom, and additional amenities including desk and vanity, and extensive locker spaces.<br /><br /><strong>Bridge:</strong> Well laid out and finished to the same standard as the rest of the yacht, there are three leather covered helm chairs which face a well arranged console. Along the aft bulkhead is a bench seat for guests to enjoy the cruise.<br /><br /><strong>Sundeck:</strong> Exceptionally large, the sun deck has a helm station and three chairs forward. Aft of this is a central four place sun bed, a long settee and table to port, refrigerator and sink to starboard. There is a hardtop that covers the sun bed area and shades the sundeck when needed. Aft of the sunbeds centered is a large 10 person Jacuzzi. Tenders and davits are further aft. It is important to note that the aft tender deck has also been strengthened to accommodate helicopter landing.<br /><br /><strong>Pantry:</strong> Located just forward of the galley, a full walk in pantry allows provisioning for extensive or remote cruising.<br /><br /><strong>Crew Mess:</strong> The crew mess is located on the lower deck forward of the laundry room and walk in refrigerator/freezer  rooms. The settee and eating area is complimented by a crew galley and entertainment center.<br /><br /><strong>Crew:</strong> 5 crew cabins for a total of 10, all with en suite baths.<br /><br /><strong>Laundry:</strong> Located on the lower deck aft of the crew mess, equipment includes (2) washers and (2) dryers, roller iron and folding area with sink.</p> \n<p style=\"text-align: justify;\"><strong>Engine Room:</strong> Centrally located aft of the guest staterooms, the engine room is serviced by an air conditioned control and switchboard room to starboard and a workshop to port. The former is equipped with the ship's central monitoring and alarm stations and the main switch gear with auto parallel and a 200 amp shore service.<br /><br /><strong>Lazarette: </strong>Set up to support water sport activities, are easily accessed through the transom door which leads out to the massive swim platform.<br /><br /><strong>Galley:</strong> Ship's galley is located on the main deck to port. A large central island with a massive top of Giallo Valenciano granite is devoted to food preparation. There are big windows and a door to the port side deck for easy provisioning.</p> \n<ul> \n <li>2 Kitchen Aid food warmers</li> \n <li>2 Scotsman Icemakers</li> \n <li>4 Subzero drawer fridge 700 BR</li> \n <li>2 Subzero drawer freezers</li> \n <li>2 Miele Dishwashers</li> \n <li>1 Viking Induction Cooktop and 1 Kitchen aid cooktop (Nov 2019)</li> \n <li>WOLF griddle SubZero Refrigerator GE GE Microwave</li> \n <li>2 Kitchen Aid Ovens (Nov 2019)</li> \n <li>Sub-Zero refrigerator</li> \n</ul>",
