            "description": "<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong><span style=\"font-size: 12pt;\">50' 2005 Pershing 50&nbsp; &quot;Catch Me If You Can&quot;</span></strong></span></p> \n<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><strong><span style=\"font-size: 10pt;\">Brand New Engines in 2009 - Only 480 hours&nbsp;</span></strong></span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><span style=\"color: #ff0000;\"><strong>PRICE NEGOTIABLE</strong></span>&nbsp;</span></p> \n<p style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Real innovations that dare to do today what becomes standard practice tomorrow. Like when Pershing introduced the hard top to the world of open yachts. The leading representative of this is the <strong>Pershing 50</strong>, a yacht that is well known for the distinctive sleek sweep of its windows with an unmistakable profile, famous twin windshield and slide away hard top. This yacht owes its fame to designing and performance that is second to none in her class. <br /> <br />This <strong>2005 50’ Pershing</strong> is different from all the others. She had brand new 900 hp MAN engines installed in late 2009 by MAN and she is cleaner than her peers.</span></p>",
