            "description": "<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong><span style=\"font-size: 12pt;\">1978 Hatteras 53' &quot;Makana&quot;</span></strong></span></p> \n<p style=\"text-align: justify;\">&quot;Makana&quot; has had the same owner since June of 1983. This yachtsman has spared no expense keeping this vessel in immaculate condition.</p> \n<p style=\"text-align: justify;\">This 53' Hatteras Motor yacht is one of Hatteras most popular models! It has 3 stateroom, 3 head, walkaround decks with a large aft deck with seating for 7, stairs lead up to an ample size flybridge with a centerline helm forward seating and aft a storage area for a 13' Boston Whaler.&nbsp; The lower accommodations have a stateroom forward with bunks and it's own head with shower.&nbsp; Aft of the forward stateroom is a full width galley with updated appliances.&nbsp; Moving aft thru the split engine room, is a port side stateroom with side by side berths and a separate head and shower starboard of the hallway.&nbsp; Leading aft is the full width master with an enclosed head and shower, the berths are split on port and starboard.</p>",
