                "title": "Aft Deck",
                "description": "<ul> \n <li>Full width sofa</li> \n <li>4 chairs</li> \n <li>Coffee table Hi-Lo</li> \n <li>Wet bar</li> \n <li>Stairs to flybridge</li> \n <li>Sliding side windows - fixed sides</li> \n <li>Wing doors</li> \n <li>2-Swing doors centerline to salon</li> \n <li>Fans</li> \n <li>Speakers</li> \n <li>Isinglass with u-zips on aft (needs replacement)</li> \n <li>Deck cleats</li> \n</ul>",
