                "description": "<ul> \n <li>Side by side berths</li> \n <li>Full height closet</li> \n <li>Full aft mirror</li> \n <li>Air conditioning control</li> \n <li>2 Portholes</li> \n <li>8-Drawers under bed</li> \n <li>4-Drawers under night stand</li> \n</ul>",
