                "description": "<p><strong>Mechanical:</strong></p> \n<ul> \n <li style=\"text-align: justify;\">Naiad Zero Speed Stabilizers including, New fins, New Head Stock and rams, New Electrical driven Powerpack (HPU), ABS Approved fiberglass strengthening to hull, new oil conditioning cooling system, New Oil reservoir, Upgraded Main Engine PTO pumps.</li> \n <li style=\"text-align: justify;\">Engine hours: Port 5553 (SMOH) / Stbd. 4918 (SMOH)<br />Generator hours: Port 4330 (SMOH) / Stbd. 2980 (SMOH)</li> \n <li style=\"text-align: justify;\">Added silver Ion filter and water filters throughout to be able to consume ships water</li> \n <li style=\"text-align: justify;\">Added an Atlas 1600 davit to the bow to be able to store 4x jetskis on the fore deck. (davit can also be moved to the swim platform if needed)</li> \n <li style=\"text-align: justify;\">Full rebuild of Sundeck davit. Nautical structures. Including all new motor, guides and cables) November 2019. Pass load tests Nov 2019</li> \n <li style=\"text-align: justify;\">Headhunter grey water monitoring system installed</li> \n <li style=\"text-align: justify;\">Top end rebuilds Port generator Nov 2018</li> \n <li style=\"text-align: justify;\">Top end rebuilds Stbd Generator Nov 2019</li> \n <li style=\"text-align: justify;\">Upgraded pumping system to MSD</li> \n <li style=\"text-align: justify;\">AC, New compressor installed to #3. Installed CIP system to all chillers</li> \n <li style=\"text-align: justify;\">Added redundancy raw water-cooling pumps to fridge/ freezer System.</li> \n <li style=\"text-align: justify;\">ALL new emergency system back up batteries</li> \n <li style=\"text-align: justify;\">Windlass port side Hydraulic Motor replaced with new.</li> \n <li style=\"text-align: justify;\">Sand media filter installed to Water maker intake system</li> \n <li style=\"text-align: justify;\">Compressed air drier and auto drain added to protect pneumatic control system.</li> \n</ul> \n<p style=\"text-align: justify;\"><strong>Interior</strong></p> \n<ul> \n <li>New custom built furniture in main salon and sky lounge with internal storage</li> \n <li>Cabin #6 refit to accommodate queen sized bed</li> \n <li>Lower guest cabin refit 3 out of 4 cabins have convertible king/ twins. All new beds, mattresses, carpet and furnishings.</li> \n <li>New sub zero draw fridge sky lounge bar</li> \n <li>All new motorized blinds controlled by remote May 2019</li> \n</ul> \n<p style=\"text-align: justify;\"><strong>Bridge</strong></p> \n<ul> \n <li>DVR recording on Camera system</li> \n <li>Upgraded Nav Computer to be able to run Nobeltec Timezero Professional.</li> \n <li>Auto pilot upgrade to be able to sail a course from Nav computer</li> \n <li>Ran multiple Cat5 cables to captain’s cabin for remote monitoring in the cabin. Nav, radar, cameras,</li> \n <li>BNWASS system installed in bridge, Capt cabin and crew Mess.</li> \n <li>2x Pepwave 4g modems installed for data</li> \n</ul> \n<p style=\"text-align: justify;\"><strong>Entertainment</strong></p> \n<ul> \n <li>Intellian TVRO upgrade to 1m dish</li> \n <li>AV Upgrade to Solsys media system. Movie and Music Library throughout.</li> \n <li>Wifi upgrade to Cisco network throughout. Controlled by Kerio controller. With Dual pepwave 4g routers.</li> \n</ul> \n<p style=\"text-align: justify;\"><strong>Galley</strong></p> \n<ul> \n <li>2 new Kitchen Aid ovens installed Nov 2019</li> \n <li>New Kitchen aid cooktop installed Nov 2019</li> \n <li>New Viking Induction cooktop installed Nov 2018</li> \n <li>Upgraded Voltage step up transformers for new galley equipment. To provide the required operating voltage.</li> \n <li>CC TV added to galley</li> \n</ul> \n<p style=\"text-align: justify;\"><strong>Deck</strong></p> \n<ul> \n <li>Removable hand rails around sun deck for Golf and water slide - 2018</li> \n <li>Raw water feed plumed to sundeck for Slide - 2018</li> \n <li>Main Deck aft dining Table installed a leaf to accommodate 12 people - 2018</li> \n <li>New sun loungers added to Sundeck aft - 2018</li> \n <li>All forward facing windows removed cleaned, trim painted and reinstalled - 2018</li> \n <li>Upgraded swim platform Aft entrance hatch, New rams on doors and new remote-control opening system - 2018</li> \n <li>Scuba tank rack - 2018</li> \n <li>Added removable swim platform shower - 2018</li> \n <li>New sun awning on sundeck - Nov 2019</li> \n <li>All new issenglass wind sheild for sundeck  - Oct 2018</li> \n <li>New chain locker floor installed - Nov 19</li> \n <li>3rd life raft added to sundeck for flag requirement to charter - 2018</li> \n <li>Air pumping system installed for inflatables - 2018</li> \n <li>Recovered Helm Sundeck Captains Chairs - Nov 2019</li> \n</ul> \n<p style=\"text-align: justify;\"><strong> </strong></p> \n<p style=\"text-align: justify;\"> </p> \n<p style=\"text-align: justify;\"><br /><br /><br /></p>",
