        "description": "<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><span style=\"color: #333399;\">\"SWEET ESCAPE\"</span> is a 130' Christensen Tri-Deck Motor Yacht with 6 staterooms comfortably accommodating 12 guests.  She recently underwent an extensive multi-million dollar refit and there are 6 weeks of upcoming charters scheduled from November 2020 through June 2021 in the Bahamas. </span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><span style=\"color: #333399;\">\"SWEET ESCAPE\"</span> is currently located in Fort Lauderdale, FL where a major engine overhaul is underway on her Caterpillar C-32's and 2 new 85kw Northern Lights generators are being installed.  </span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">The seller is motivated to put a deal together before November and all offers are encouraged. </span></p>",
