            "id": 7460037,
            "status": "active",
            "condition": "used",
            "description": "<p style=\"text-align: left;\"><strong><span style=\"font-size: 12pt; color: #000080;\">\"Kaleen\"</span></strong><span style=\"font-size: 12pt; color: #000080;\"><span style=\"color: #000080;\"><span style=\"font-size: 12pt;\"> </span></span><span style=\"color: #000000;\"><span style=\"font-size: 12pt;\">is a 1983/2017 Broward 110' Enclosed Bridge Motor Yacht featuring a massive full beam salon, full beam master mid-ship and a spacious on deck VIP. She has a rich yachting history and has been owned by the same family for nearly 20 years. </span></span></span></p> \n<p style=\"text-align: left;\"><span style=\"font-size: 12pt; color: #000080;\"><span style=\"color: #000000;\"><span style=\"font-size: 12pt;\"><span style=\"color: #000080;\"><strong>\"Kaleen\"</strong></span> was hailed the crown jewel of Broward Marine at her launch and has been maintained the highest standards her entire life.  Her recent major refit in 2017 combined with an aggressive asking price makes <strong><span style=\"color: #000080;\">\"Kaleen\"</span></strong> a must see within the market.  </span><span style=\"font-size: 12pt;\"><br /></span></span></span></p>",
