            "description": "<p style=\"text-align: center;\"><strong>\"<span style=\"color: #000080;\">Shark Byte\"</span> </strong><span style=\"font-size: 12pt;\">is a 2001 Cruisers 3672 Express with new 496 Mercruiser long blocks installed July of 2019.</span></p> \n<p style=\"text-align: center;\"><strong>\"</strong><span style=\"font-size: 12pt; color: #000080;\"><strong>Shark Byte\"</strong></span><span style=\"font-size: 12pt;\"> has an updated electronics package which includes a Garmin 7212 radar/chart plotter, Raymarine, and Lowrance depth sounders. </span></p> \n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 12pt;\">Recent Updates and More Information</span></span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">- 57 hours on new engines</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">- New eisenglass and zippers November of 2019</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">- New refrigerator 2018 </span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">- New TV/DVD, soundbar, Fushion radio with Bluetooth May of 2020</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">- New batteries, alternators, and starters June of 2020 </span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-New water heater July of 2020</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-New Bilges pumps September of 2020</span></p>",
