        "id": 7522496,
        "status": "active",
        "condition": "used",
        "description": "<p><em>Owner May Consider Later Model Vessels 95'-100' in Trade</em></p> \n<p><em>Kabir</em> is an elegant, beautifully styled, 2007 130 Ft. Mangusta M130S Limited Edition and is a magnificent example of what Overmarine is capable of producing.  Designed by Stefano Righini she was built in Viareggio, Italy  to <em>Bureau Veritas</em> Class.  Unlike the conventional M130, this super-yacht features a raised pilot house and a flybridge, dramatically increasing both the interior volume and the outside deck areas, allowing space for two saloons.  Her lavish interior was designed by Luxury Interiors.  In July 2020 she completed a massive refit with over $1.8m invested that includes many outstanding upgrades. </p> \n<p>Highlights of the 2020<strong> $1.8m </strong>Recently completed <strong>Refit:</strong></p> \n<ul> \n <li>New Humphree Stabilization system including “at anchor” option (stabilizers do not hinder the performance that these vessels are known for) </li> \n <li>New KVH HD11 satellite system for worldwide television service </li> \n <li>New 4009 VSAT antenna and dome  </li> \n <li>New custom day head on sundeck</li> \n <li>New Atlas 75kw shore power converter, with warranty</li> \n <li>Complete new air conditioning system: 3 Compressors, pumps, 32 air handlers </li> \n</ul> \n<ul> \n <li>New Main Switchboard upgrade for automatic seamless transfer operations between generators and shore power.  Touch screen operation, load sharing, and automated paralleling of generators</li> \n</ul> \n<ul> \n <li>New Custom Engine room and Metcalf Marine Exhaust systems for port and starboard Main Engine Exhausts</li> \n <li>Generator ends </li> \n <li>New Main Engine Batteries </li> \n <li>All New Zincs </li> \n <li>New Gyro</li> \n</ul> \n<p> </p> \n<p> <strong>\"Kabir\" not for sale to U.S. residents in U.S. waters</strong></p>",
