            "title": "130 Mangusta",
            "description": "The 2007 130' OVERMARINE GROUP Mangusta M130S Kabir is a yacht for sale located in Miami, Florida, USA.\r\nKabir is an elegant, beautifully styled, 2007 130 Ft. Mangusta M130S Limited Edition and is a magnificent example of what Overmarine is capable of producing.  Designed by Stefano Righini she was built in Viareggio, Italy  to Bureau Veritas Class.  Unlike the conventional M130, this super-yacht features a raised pilot house and a flybridge, dramatically increasing both the interior volume and the outside deck areas, allowing space for two saloons.  Her lavish interior was designed by Luxury Interiors.  In July 2020 she completed a massive refit with over $1.8m invested that includes many outstanding upgrades. ",
