          "salesMessage": "<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">Joe Williams</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">Yacht Consultant/Broker</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">Email: joe@thrive-maritime.com</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">Call now for more information - 954-804-1035</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">&nbsp;</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">Dave D&rsquo;Onofrio Yacht Sales, a Fort Lauderdale yachting institution for nearly forty-years, is now YachtAccess - a new name and a new brand, but the same impeccable reputation for service that we&rsquo;ve earned over the last four decades. We are intent on continuing our exceptional track record of sales and purchases, but most importantly, our long history of personalized customer service.&nbsp;</span><span style=\"font-size:19px;line-height:115%;\">&nbsp;</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">The fact is that there are many brokerages and brokers in the business, both large and small. &nbsp;YachtAccess is a small brokerage with a big history of service to our clients. We would appreciate the opportunity to discuss marketing your boat or assisting in your search for a new one and would welcome the chance to be your broker. We look forward to speaking with you personally.</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">&nbsp;</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">Your Personal Yacht Access Professionals</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\">&amp; Yacht Purchasing Consultants</span></p>\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 1; font-size: 15px; font-family: Calibri, sans-serif;\"><span style=\"font-size:19px;line-height:115%;\"><a href=\"https://www.YachtAcccess.com\">https://www.YachtAcccess.com</a> </span></p>\r\n<p><br></p>",
