            "id": 6332278,
            "status": "active",
            "condition": "used",
            "description": "<p><em><strong>INCREDIBLE VALUE FOR AN OUTSTANDING VESSEL!</strong></em></p> \n<p><span style=\"color: #ff0000; font-size: 12pt;\"><em><strong>New black bimini top installed!&nbsp; 2/20&nbsp; Fresh&nbsp; black bottom paint, the black boot stripe polished, the hull acid washed,&nbsp; 4/20&nbsp; New a/c pump 6/20, New Windshield Washer motors 6/20.&nbsp; Compounded and Waxed 8/20</strong></em></span></p> \n<p><span style=\"color: #ff0000; font-size: 12pt;\"><em><strong>1000 Hour service just completed 8/20 along with full Generator service.</strong></em></span></p> \n<p><span style=\"font-size: 12pt;\"><em><strong>2001 Tiara 4000 Express,&nbsp;&nbsp;lightly&nbsp;used,&nbsp;professionally maintained,&nbsp;in exceptional condition&nbsp;and turnkey !</strong></em></span></p> \n<p><span style=\"font-size: 12pt;\"><strong>This vessel is owned by a licensed captain/caring owner that has been boating for more than 50+ years. The elderly owner is no longer able to use boat as frequently as he’d like to, he will consider accepting a reasonable offer on this meticulously maintained vessel.</strong></span></p> \n<p><span style=\"font-size: 12pt;\"><strong>Pride of ownership is apparent everywhere when you step aboard this beautiful Cummins Turbo-Charged Engines (Factory Upgraded Power Option) Tiara Express, You simply won't find a cleaner 4000 Express on the market today. &quot;Silver Lining&quot; is kept professionally maintained in Boca Raton, FL and is easy to show.&nbsp;&nbsp;</strong></span></p> \n<p><span style=\"font-size: 12pt;\"><strong>Also included but not limited to, monthly diving and zinc replacements (when needed), and regular bi-weekly professional washings. Key notes, items replaced between 2016 and 2017: Forward A/C unit (7000btu) and the Main Salon unit (16,000btu), A/C Sea Water Pump, Refrigerator, Cockpit Icemaker, Flat Screen TV in Salon, House and Engine Battery Banks, VHF Radio, Raytheon Depth Sounder, Raytheon GPS, Raytheon Plotter Chart Chip, and the remote spotlight.&nbsp;&nbsp;</strong></span></p> \n<p><span style=\"font-size: 12pt;\"><strong>As part of regular professional monthly systems checkup, all hoses and clamps, pumps, fuel and hydraulic lines, fuel and engine filters, fittings, impellers, fuses, etc., are replaced whenever needed. &nbsp;This regular monthly professional maintenance program also includes the boat being professionally washed every other week and a diver bottom cleaning and replacing zincs monthly.</strong></span></p> \n<p><span style=\"font-size: 12pt; color: #ff0000;\"><strong>This boat is a must see!</strong></span></p> \n<p>&nbsp;</p>",
