            "description": "<p><span style=\"font-size: 12pt;\"><strong>Hovertrek Hovercraft Rescue Deluxe 6 Passenger Inline Seating Model 5852</strong></span></p> \n<p><span style=\"font-size: 12pt;\">Single Gas HIRTH 100HP Carbureted Engine with Reverse Thrusters!</span></p> \n<p><span style=\"font-size: 12pt;\">Trailer Included and all Standard Electronics Package. (See Video)</span></p> \n<p><span style=\"font-size: 12pt;\">Price: $73,400 </span></p> \n<p><span style=\"font-size: 12pt;\">Our Hovertrek Hovercraft Rescue Deluxe 6 Passenger Inline Seating Model 5852 is fully assembled with all standard options. The price on this Rescue 5852 features the largest HP engine package (100HP) available for this model; a Custom Hovercraft Trailer; Standard Electronics Package and Reverse Thrusters! (see video).</span></p> \n<p><span style=\"font-size: 12pt;\"><strong>Neoteric Rescue Hovercraft - The Industry Standard</strong></span></p> \n<p><span style=\"font-size: 12pt;\">First responders worldwide recognize that a hovercraft is the only rescue vehicle able to perform fast, safe rescue operations on swift water, thin or broken ice, flood waters, mud and snow. Because it safely hovers 9 inches above the terrain, a hovercraft keeps your rescue team above the danger – not in it – and gives you access to areas a boat or helicopter cannot reach.</span></p> \n<p><span style=\"font-size: 12pt;\">But the Neoteric Hovertrek™ is not just another rescue hovercraft. Its unique capabilities have made it the industry standard worldwide. Our clientele spans 50+ nations and includes the U.S. Border Patrol, Department of Homeland Security; Police, Sheriff and Fire Departments; Airport Police/Fire/EMS Services; National Parks Services, and more.</span></p> \n<p><span style=\"font-size: 12pt;\">There is no vehicle comparable to a hovercraft – especially the Neoteric Hovertrek. With the Hovertrek, you won't own just a versatile sport and utility vehicle; you'll own more than 40 years of solid research and development, unsurpassed engineering, award-winning design, and the only hovercraft in the world with effective brakes. Features: Patented Reverse Thrust; Customizable; Lightweight; Trailerable; Lowest Profile.</span></p> \n<p><span style=\"font-size: 12pt;\">JUST IMAGINE accessing places that no other vehicle can reach. Whether you’re trying to traverse now, rapids, shallow or marshes, a hovercraft can get you there. Need to cross tidal areas or ice to your island? Think hovercraft. Need to save the life of someone who has fallen through the ice or trapped by flood waters without becoming a victim yourself? A Neoteric hovercraft is your safest bet, and you don’t even need a dock. Designed by the most experienced engineers in the business Neoteric Hovercraft outperform the competition in reliability, maneuverability and quality of construction. So, what are you waiting for? Whether it’s for work or play, inquire today so we can help you plan how to dominate your terrain.</span></p> \n<p><span style=\"font-size: 12pt;\">Our Hovercraft have several different engine packages with lots of additional options. Depending on how you intend to use your Hovercraft will help us determine the right model, engine package and custom options that will best suit your needs. </span></p> \n<p><span style=\"font-size: 12pt;\"><strong>Inquire to receive the full Hovercraft Specifications for this Rescue Model 5852.</strong></span></p>",
