        "description": "<p>3D Virtual Tour Available. </p> \n<p>KIMBERLY is a USA-built, tri-deck motoryacht with Palmer Johnson pedigree and an ownership history of very experienced yachtsmen. Her interior volume is impressive for the length at 321 gross tons, highlighted by an absolutely massive main salon, excellent skylounge, complimented by generous outdoor spaces. A wonderful boat for traveling or entertaining guests, the cherry wood interior is elegant, yet warm and inviting. KIMBERLY has benefited from several refits during her history and has undergone extensive maintenance and upgrades under the current ownership.</p> \n<p>KIMBERLY is a rare find in this category in terms of volume, pedigree and overall quality. She must be seen to fully appreciate.</p>",
