                "title": "Electrical Equipment",
                "description": "<ul> \n <li>Generator: (2) John Deere 4045TF275 65kW</li> \n <li>Battery: (16) Full Force 12V-8D</li> \n <li>Transformer: (2) Charles ISO Boost 100</li> \n <li>Charger: Phase Three PT-80 12v 2 bank</li> \n <li>Charger: Phase Three PT-24-45U 24v 2 Bank</li> \n <li>Inverter: Magnum MangSine inverter Charger</li> \n <li>Shorepower: (2) 100amp 240V single phase&nbsp;</li> \n</ul>     \n<p>&nbsp;</p>",
