        "description": "<p>Highlights:</p> \n<p>-MAJOR MECHANICAL REFIT by RPM</p> \n<p>-Port engine rebuilt from block up</p> \n<p>-Stbd engine rebuilt</p> \n<p>-Both transmissions rebuilt</p> \n<p>-New Exhausts</p> \n<p>-NEW black and gray water lines</p> \n<p>-ALL Gold has been replated throughout vessel</p> \n<p>-2020 NEW Chillers, air handlers serviced</p> \n<p>-Galley repainted, NEW Oven</p> \n<p>-Flybridge hot tub, refinished and painted</p> \n<p>-Fresh bottom paint 04/20</p> \n<p>-2020 Top Rail varnished </p> \n<p>-Tender fully serviced</p> \n<p>-NEW water heater</p> \n<p><strong><br /><br /></strong></p> \n<p>Main Engines</p> \n<p><strong> </strong></p> \n<p>MTU 16V2000 M-91 @ 2,000 Hp each, Zero hours</p> \n<p>-Port Engine NEW BLOCK UP</p> \n<p>-STBD Engine Rebuilt</p> \n<p><strong> </strong></p> \n<p>Transmission for Main Engines, ZF, 2,778:1 ratio</p> \n<p>-BOTH Fully Rebuilt</p> \n<p><strong> </strong></p> \n<p>Generators</p> \n<p><strong> </strong></p> \n<p>-Two Kohler 65 kW Generators, 2800 hours, recent service </p> \n<p><strong> </strong></p> \n<p>Electric</p> \n<p><strong> </strong></p> \n<p>-Atlas system </p> \n<p><strong> </strong></p> \n<p>Other Machinery </p> \n<p><strong> </strong></p> \n<p>Watermakers, Idromar MC3J-1220 </p> \n<p><strong> </strong></p> \n<p>Communication Systems</p> \n<p>-VHF: Fixed, ICOM IC-M603   </p> \n<p>​</p> \n<p>Navigation Systems</p> \n<p><strong> </strong></p> \n<p>Radar</p> \n<p>-Raymarine E-80, range 64 miles </p> \n<p><strong> </strong></p> \n<p>Auto Pilot </p> \n<p>-Raymarine ST2-90 Depth Sounder</p> \n<p>-Raymarine ST2-90 GPS </p> \n<p>-Raymarine Laser Plotter </p> \n<p>-Raymarine E-120 Navtex </p> \n<p>-JRC-NCR-333</p> \n<p><strong> </strong></p> \n<p>Galley</p> \n<p><strong> </strong></p> \n<p>Main Galley Equipment</p> \n<p>Cooking Equipment</p> \n<p>-Two Teka YT-TC-2P.1.2   </p> \n<p>-Oven, NEW Gaggenav   </p> \n<p>-Microwave, GE </p> \n<p>-Refrigeration/Freezer, Subzero</p> \n<p>-Icemaker </p> \n<p>-Large Wine-Cooler </p> \n<p>-Dishwasher, Bosch-Silence Plus </p> \n<p>-Trashcompactor, Bosch</p> \n<p><strong> </strong></p> \n<p>Laundry Equipment</p> \n<p><strong> </strong></p> \n<p>-Main Laundry Equipment Washer & Dryer, Miele (pantry)</p> \n<p> </p> \n<p> </p> \n<p>Accommodations</p> \n<p>General</p> \n<p>Azimut 116 has guest accommodations for up to 10 in 5 staterooms, along with crew accommodations for up to 6 in three cabins.</p> \n<p><strong> </strong></p> \n<p>Owner</p> \n<p>The master cabin is located on the main deck forward.  It features a king bed, complete bath with shower and separate Jacuzzi tub. Electric frosted privacy glass.</p> \n<p><strong> </strong></p> \n<p>Guests</p> \n<p>The VIP cabin is located forward on the main deck.  It features a complete bath with shower.            </p> \n<p>The two double cabins are located on the lower deck and they both have private baths with showers.           </p> \n<p>In addition, the twin cabin is also located on the lower deck with two twin beds & Pullman with bath and shower. </p> \n<p><strong> </strong></p> \n<p>Crew</p> \n<p>The crew accommodations are located in the lower level bow.  The captain quarters feature a double bed with private bathroom and shower.  The two twin cabins each have two single twin beds and their own bathrooms with showers.</p>",
