            "description": "<p>BACK ON THE MARKET!</p> \n<p>TRANSFERABLE WARRANTY UNTIL 05/24/2023</p> \n<p>PASSPORT PREMIERE WARRANTY including Accessory packages: CAPTAINS CLASS, NAVIGATION CLASS, GENERATOR. Your coverage also includes the following Upgrade packages: WEAR UPGRADE, WEAR UPGRADE, MAJOR CASTINGS, MAJOR CASTINGS, LIMIT OF LIABILITY $50,000 - 750 HP, LIMIT OF LIABILITY $50,000 - 750 HP.</p> \n<p>99% FRESH WATER**, BARN KEPT 8 months a year. Needs very little to be in \"like new\" condition!</p> \n<p>**vessel being placed in the Hudson 7/28/20.</p> \n<p>ONLY 200 HOURS on desirable MIAMI SILVER hull color</p> \n<p><span style=\"text-decoration: underline;\"><strong>Optional Equipment - </strong></span></p> \n<ul> \n <li>Additional bed in aft cabin</li> \n <li>Oskar cockpit chair</li> \n <li>Icemaker in cockpit/salon</li> \n <li>Raymarine Platinum Package</li> \n <li>Exterior courtesy lights</li> \n <li>Premium Package(Cockpit BBQ, Tender garage launching system, bow thruster, chaincounter control on helm station, cover for aft sun cushions, electric searchlight)</li> \n <li>Sofa/bed in dinette</li> \n <li>Cushions and covers for bow seating</li> \n <li>Teak on cockpit, swim platform, and side decks</li> \n</ul> \n<p>Known serviceable items..soft top cable needs to be serviced and/or replaced. Several small marks in hull paint. Needs new bow thruster impeller, zincs, stbd propeller cone and cushion spot cleaning. </p> \n<p> </p> \n<p> </p>",
