            "id": 6966717,
            "status": "active",
            "condition": "used",
            "description": "<p>Captain maintained 2016 Numarine 62 Fly for sale. \"SEBASTIAN\" has three staterooms and three heads plus crew. Her fly bridge is generous and expansive complete with wet bar, grill, table, and sunpad. There is a full bimini top over the fly bridge that can be put down for bridge clearance or sun exposure. </p> \n<p>Manufacturer provided description:</p> \n<p>Following the glamorous success of the 70' and 78' models, the shipyard has unveiled its latest masterpiece: the Numarine 62, available in both Flybridge and Hardtop versions. Two new additions to Omer Malaz's pearl necklace.   Measuring 19.16 metres overall, the Numarine 62 successfully reproduces the same concept and sporty design common to all the yard's family line products.   But do not call it a compact yacht: ample open areas and brightly lit interiors define the shipyard's traditional and unique distribution of space, while the use of the IPS transmission system enabled the fitting of oversized fuel tanks, thus making the craft a cruiser with no boundaries.</p>",
