        "condition": "used",
        "description": "<p>\"Available for inspection October 15-25 in Seattle, WA\"</p> \n<p>Check out STEADFAST's 3D Tour!</p> \n<p>Seldom do truly great yacht opportunities come on the market. The very best purpose-built platforms tend to stay with owners for extended periods because they are appreciated and enjoyed for what they were built to do. This type of vessel, when matched with an exceptional owner, makes for an unparalleled team, which creates the unique experiences one can have on the sea. But eventually, the time comes to let the vessel pass on to its next caretaker. After years of adventure, STEADFAST is now ready for a new family to cherish and make new memories.</p>",
