                "title": "N&amp;J Disclaimer",
                "description": "<p><span style=\"color: #000000; font-family: Arial; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;\">Specifications and details of this vessel are provided in good faith for informational purposes only. Data regarding the specifications, operating characteristics and condition of the vessel was obtained from sources believed reliable but is not guaranteed by owner or brokers. Buyer assumes responsibility to verify all speeds, capacities, consumption and other measurements contained herein and otherwise provided and agrees to instruct his agent or surveyor to confirm such details prior to purchase. Vessel is offered subject to prior sale, price and inventory changes and withdrawal from market without notice.</span><br /><br /><span style=\"color: #000000; font-family: Arial; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;\">Engine hours are as of the date of the original listing and are a representation of what the listing broker has been told by the owner and/or actual reading of the engine hour meters. The broker cannot and does not guarantee the true hours. It is the responsibility of the purchaser to verify engine hours, warranties implied or otherwise, and major overhauls as well as all other representations noted on the listing brochure.</span></p>",
