            "condition": "used",
            "description": "<p>RUNAWAY is an Alan Andrews designed, Dencho Marine built, Custom 70 Turbo racing cruising sloop. The tall Omohundro Carbon Fiber rig with five spreaders was new in 2000. The carbon fiber hull was up upgraded and modernized with extensive alterations to the bow and stern sections in 2000-2001. The deck was completely stripped of all winches and hardware and professionally Awlgripped with a new non-skid surface in 2017. In 2019 a bow roller and anchor winch were installed along with a roller furling headsail and a couple of electric winches.</p>",
