        "condition": "used",
        "description": "<p style=\"text-align: center;\"><span style=\"color: #ff0000;\"><span style=\"color: #313131;\">ARKADIA was built for a US client so she has the dual voltage electrical configuration and the tropical air conditioning option.  She was launched in late 2017. Accommodation is for up to ten guests split across five cabins, including a large master cabin suite that is situated forward on the main deck. Two VIP suites and two twins on the lower deck complete the guest layout, while the crew quarters allow for a staff of up to six people.</span></span></p> \n<p>The exterior design of ARKADIA combines both sophistication and comfort. The larger and curved hull offers considerably more interior and exterior volume than a traditional raised pilothouse of the same length.  The Tri-Deck configuration allows for the additional full beam Sky Lounge that is not offered in most raised pilothouse yachts.. Along with traditional styling Sanlorenzo was able to blend in modern elements found in the range as well, such as folding balcony found off the main saloon and the large hydraulic swim platform. </p> \n<p>Marty Lowe designed the interior features with light tones, with a modern ambiance thanks to the American elm wood, used for both the walls and for the furniture.  The ARKADIA interior decor package is called the \"St Barts\" package for the beautiful ocean and beach inspired inspiration for the decor. </p> \n<p>Disclaimer: The Sea Doo and Williams tender are not included in the sale of the Vessel.</p>",
