            "descriptions": [
              {
                "descriptionType": "dealer-comments"
              },
              {
                "descriptionType": "description",
                "title": "Some Quick Specs &amp; Additional Information",
                "description": "<p>This Benetti is hull number 20 of the Benetti Tradition 100 series.&nbsp; Over €400,000 were spent upgrading this&nbsp; 4 deck vessel&nbsp; during build. &nbsp;&nbsp; The&nbsp; vessel is also equipped &nbsp; with &nbsp; zero speed stabilizers, SAT tv Seatel 3004E, underwater lights, one jet ski, one seabob.</p> \n<p><span>Builder:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Benetti</span></p> \n<p><span>Year:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2009</span></p> \n<p><span>LOA:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 30.23m / 100ft</span></p> \n<p><span>Beam:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 7.16m / 23ft</span></p> \n<p><span>Draft:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2.0m / 6.45ft</span></p> \n<p><span>Registry:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Marshall Islands</span></p> \n<p><span>Displacement: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 152 tons</span></p> \n<p><span>Designer:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Stefhano Righini, Francois Zuretti</span></p> \n<p><span>&nbsp;</span></p> \n<p><span>Electrical and Mechanical Equipment</span></p> \n<p><span>Engines:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x Caterpillar C18 1000hp</span></p> \n<p><span>Generators:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x Kohler 50 kVa</span></p> \n<p><span>Shorepower:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 380 VAC / 3 phase</span></p> \n<p><span>Power System:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 24V / 220V</span></p> \n<p><span>Air Conditioning:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Condaria</span></p> \n<p><span>Watermaker: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Idroma MC8S</span></p> \n<p><span>Waste Treatment: &nbsp; &nbsp; &nbsp; Hamman</span></p> \n<p><span>Stablizer: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;VT Najad Marine (Zero Speed)</span></p> \n<p><span>Air Compressor:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 360 litres per minute @ 8 bar&nbsp;</span></p>",
                "visibility": "public"
              },
              {
                "descriptionType": "description",
                "title": "Accommodations",
                "description": "<p>This Benetti 100 is built with the much desired on deck master and also built with a full beam VIP guest state room below deck which rivals the comfort of a master. Two other guest state rooms located below deck, each ensuite with 2 twins each, ensure comfort for the guests .</p> \n<p>&nbsp;</p> \n<p>The crews quarters entered through a staircase forward of the galley ensure privacy for the owners and guests is divided into a crew mess with small galley , dinette table, and a small comfortable&nbsp; seating area . The captain's quarters is located to starboard , equipped with a queen bed ensuite bathroom and shower with hydromassage . Also equipped with a repeater data display from the wheelhouse . To the port two staterooms with upper and lower Bunks for the crew.</p> \n<p>&nbsp;</p> \n<p>&nbsp;</p>",
                "visibility": "public"
              },
              {
                "descriptionType": "description",
                "title": "Disclaimer",
                "description": "The Company offers the details of this vessel in good faith but cannot guarantee or warrant the accuracy of this information nor warrant the condition of the vessel. A buyer should instruct his agents, or his surveyors, to investigate such details as the buyer desires validated. This vessel is offered subject to prior sale, price change, or withdrawal without notice.",
                "visibility": "public"
              }
            ],
