            "description": "<p>The Monte Carlo Yachts 70’s distinctive exceptional design and comfort built with a superior fit and finish delivers&nbsp;&nbsp;excellent performance and handling in an overall design that looks more like a sleek and capable sport cruiser than a motor yacht.</p> \n<p>The interior decoration is unique and elegant creating a living experience that is both warm and contemporary. The use of reflective materials and lacquered woods emphasizes brightness throughout the interior spaces. These elements are softened by the natural wood flooring and vertical panels and rich fabrics, which provide a pleasant contrast to the crisp lacquered interiors. &nbsp;</p> \n<p>A great yacht for diving, fishing or just cruising, the owner has kept the yacht in “like new condition” ready to explore the beautiful waters of the South Pacific! &nbsp;</p>",
