            "descriptions": [
              {
                "descriptionType": "dealer-comments"
              },
              {
                "descriptionType": "description",
                "title": "Pirelli PZero 1400 Open Outboard Edition",
                "description": "<p style=\"text-align: justify;\">This listing showcases a 2014 Pirelli PZero 1400 Open Outboard Edition featuring triple Mercury 300s with joy stick controls &amp; digital monitoring systems.&nbsp;</p> \n<p style=\"text-align: justify;\">This exact model was featured as a Demo boat in the Cannes, Monaco, &amp; Genoa Boat Shows and has about 150 hours on the engines due to customer sea trials.</p> \n<p style=\"text-align: justify;\">Every option available is onboard.&nbsp;</p> \n<p style=\"text-align: justify;\">This engine package gives you a top speed over 50 knots and the ease of docking &amp; maneuvering with a joystick.</p> \n<p style=\"text-align: justify;\">Available for immediate purchase &amp; can be shipped to any location in the world.&nbsp;</p> \n<p style=\"text-align: justify;\">Currently located in Italy near Genoa and available for sea trials.&nbsp;</p> \n<p style=\"text-align: justify;\">Pricing Available Upon Request</p> \n<p style=\"text-align: justify;\">IMPORTANT - THIS IS AN OPPORTUNITY TO BY A 1400 OUTBOARD EDITION IN NEW CONDITION AT A MAJOR DISCOUNTED PRICE WITH NO DELIVERY PERIOD</p> \n<p style=\"text-align: justify;\">We can obviously custom build a new 1400 Outboard Edition and deliver anywhere in the world within 30-60 days.&nbsp;</p>",
                "visibility": "public"
              },
              {
                "descriptionType": "description",
                "title": "Disclaimer",
                "description": "The Company offers the details of this vessel in good faith but cannot guarantee or warrant the accuracy of this information nor warrant the condition of the vessel. A buyer should instruct his agents, or his surveyors, to investigate such details as the buyer desires validated. This vessel is offered subject to prior sale, price change, or withdrawal without notice.",
                "visibility": "public"
              }
            ],
