        "description": "<p>The 110' Cockpit Motor yacht 'Isabella' was built by Broward in the&nbsp;United States at their Saugatuck, MI shipyard. Originally a 104' Broward and the addition of the cockpit at the factory makes her 110'. This luxury vessel's sophisticated exterior design and engineering are the work of Broward. Her luxurious interior was originally designed by Dee Robinson Interiors. Her exterior is styled by the Broward team who are also responsible for the entire engineering package. Her current owner has continually refitted many aspects of this yacht's systems and finishes.</p> \n<p><strong>Isabella's</strong>&nbsp;interior configuration has been designed to comfortably accommodate up to 6 guests overnight in 3 cabins, comprising a master suite, 1 VIP stateroom, 1 twin cabin and 1 Pullman bed. She is also capable of carrying up to 3 crew onboard in 2 (Oversized) cabins to ensure a relaxed luxury yacht experience.</p> \n<p><strong>Isabella</strong> features a semi-displacement aluminum hull and superstructure.</p> \n<p>Motor yacht Isabella is equipped with a stabilization system which reduces roll motion effect and results in a smoother more enjoyable cruising experience underway.</p> \n<p>Powered by 2 Detroit Diesel (16 V 92 TA) 1,449hp diesel engines and propelled by her twin screw propellers. She is capable of a top speed of 27 knots and comfortably cruises at 19 knots. At 10 knots she sips 20 gallons per hour. She can carry around 10,800 of diesel on-board in her fuel tanks.&nbsp;</p> \n<p>&nbsp;</p>",
