            "description": "<p>Webber Grand piano with piano-mation by yamaha connected to Bose sound system</p> \n<p>Zinc Dining table for 8</p> \n<p>White Chesterfield Couch</p> \n<p>Samsung 60&quot; flatscreen&nbsp;</p> \n<p>Dolomite stone tops</p> \n<p>Stacked stone accent wall with pillars</p> \n<p>Day Head</p> \n<p>&nbsp;</p> \n<p>&nbsp;</p> \n<p>&nbsp;</p>",
