            "status": "active",
            "condition": "used",
            "description": "<p style=\"text-align: center;\">This is an extensively refit and nearly flawless 52' Ocean Alexander built in 2006 and completely redone in 2018 by her current owners. &nbsp;All the work was preformed by<strong> CAY Marine in Miami Florida</strong> with well over 200k spent. &nbsp;This yacht shows as if she were new and carries low hours on her reliable Yanmar engines. &nbsp;All services are up to date and this yacht is truly turn key and ready for an owner operator. &nbsp; &nbsp;</p> \n<p><strong>Upgrades since 2018 by CAY Marine:</strong></p> \n<ul> \n <li>New Garmin electronics and radar&nbsp;</li> \n <li>New hull paint job in stars and stripes blue&nbsp;</li> \n <li>Entire paint job from the rub rail up in Snow White&nbsp;</li> \n <li>Complete replacement of teak decking to &quot;Deck King&quot; on afterdeck, swim platform and stairs.</li> \n <li>New nonskid on side decks and foredeck</li> \n <li>New exterior cushions in blue and white on bridge, foredeck and entire exterior.&nbsp;</li> \n <li>New polycarbonate 3-sided enclosure&nbsp;</li> \n <li>New refrigerator on bridge by Isotherm</li> \n <li>New refrigerator in galley by Virtifrigo&nbsp;</li> \n <li>New cutlass bearings and complete bottom job&nbsp;</li> \n <li>Props and shafts dropped, alighted, tried and trued&nbsp;</li> \n <li>New interior carpeting throughout</li> \n <li>New outdoor carpeting on bridge</li> \n <li>New ice maker in salon by U-Line</li> \n <li>New 42&quot; Samsung TV in salon</li> \n <li>Docking station added to aft deck&nbsp;</li> \n <li>New exhaust elbows</li> \n <li>Rebuilt turbos</li> \n <li>New exhaust lines&nbsp;</li> \n <li>New freshwater pump</li> \n <li>All new bilge pumps in 2019</li> \n <li>Haitian style shade awning for cockpit</li> \n <li>New Satellite TV dome by KVH</li> \n <li>(2) Stidd helm chairs in bridge</li> \n <li>Extra seating added to port in bridge to create a full U-shape</li> \n <li>New JL Audio sound system with Fusion head unit</li> \n <li>Hardtop underside painted grey blue to match carpet and accent the hull</li> \n <li>New covers for all exterior cushions.</li> \n <li>All plastic hardware latches on the exterior were removed and upgraded to stainless steel</li> \n <li>Boarding gates and railing added for safety on aft deck. &nbsp;</li> \n <li>Safety line added to bow rail for safety and aesthetics appearance&nbsp;</li> \n <li>Stainless steel gate added to access bridge</li> \n <li>New 30&quot; TV in master</li> \n <li>All new batteries</li> \n</ul> \n<p><strong>Notable Features</strong></p> \n<ul> \n <li>Bow thruster</li> \n <li>Hardtrop</li> \n <li>Spare props include</li> \n <li>Low hours - 1170 total and 1000 hour service completed</li> \n <li>12kw Onan generator fully serviced</li> \n <li>Old mirror headboards were removed and leather wrapped&nbsp;</li> \n <li>Washer/dryer combo unit</li> \n <li>Huge aft storage below decks</li> \n <li>Euro style transom</li> \n <li>(3) Stateroom, (2) head layout</li> \n <li>In pristine condition throughout the vessel</li> \n</ul>",
