        "description": "<p>Built by Broward Marine in 1995, “Alexandra Jane” has a classic exterior look, but has benefitted from an extensive 2019 refit to update her interior and systems. “Alexandra Jane” has been heavily chartered in the Bahamas and has several successful seasons under her belt. <br /> <br />Her successes as a charter vessel are due in no small part to her expansive and relaxing deck areas, contemporary interior, and wide array of water toys. Her exterior living spaces include a spacious flybridge with bar, dining areas, sunpads, and a hot tub. Her aft deck also offers an option for al fresco dining, or you can enjoy a quiet moment on the foredeck’s intimate seating area. Inside, you’ll find airy and comfortable living spaces to include a large salon and dining area, country kitchen style galley, and full beam master. These spaces are flooded with natural light and decorated in neutral tones. <br /> <br />“Alexandra Jane” isn’t all about relaxation, though. She also knows how to have fun. Included in her sale are approximately $100,000 in toys to include two jet skis, two sea bobs, waterslide, dive compressor and dive gear, snorkeling equipment, and paddle boards – to name a few. Her 32’ 2011 Intrepid Center Console is available for separate purchase as well (inquire for price). “Alexandra Jane” is truly more than just a yacht – she is a complete charter operation package, and she is ready for a new owner.</p> \n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: 12pt;\">Key Features:<br /></span></span><span style=\"font-size: 12pt;\">*Turn-key charter program</span><span style=\"font-size: 12pt;\"><br />*Full-time captain and crew maintained<br />*Extensive inventory of toys included in sale<br />*2019 Refit including electronics, interior, and mechanical upgrades<br />*$100k+ in toys<br /></span><span style=\"font-size: 12pt;\">*2019 Full engine &amp; generator overhaul</span><span style=\"text-decoration: underline;\"><span style=\"font-size: 12pt;\"><br /></span></span></p>",
