            "description": "Stepping aboard the 74' Hatteras the first thing you will notice is how clean and updated she is. The owner has spared no expense to ensure that she is presented in excellent condition. From the decks to her updated interior and modern galley appliances. On this vessel even the always spotless engine room belies her age. \n<br />\n<br />Each of this yacht's four staterooms is tastefully decorated, the carpeting, upholstery and woodwork are in premium condition. The full beam king berth master stateroom is very private, accessed by its own companionway and with a his-and-her heads. The three other staterooms are located forward and have en-suite heads. \n<br />\n<br />A beautiful example of a classic Hatteras yacht, exceeds expectations and enters the market priced to sell. This boat must be seen to be appreciated so contact us today to set up your showing. It will not disappoint. \n<br />",
