            "description": "<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">&nbsp;The Beneteau Monte Carlo 5S takes the next step in the evolution of her sister's - the MC5 - success. In the &quot;S&quot; model, the flying bridge version gives way to a sedan design, still utilizing the upper deck for sun bathing and entertaining. The upper deck layout allows a private area for sunning and relaxation. Features include 3 staterooms and 2 heads, a 6-person salon, upper deck for sunbathing or entertaining, transom compartment, twin Volvo IPS 600 engines, IPS joystick controls, electric windlass and much more! The Beneteau Monte Carlo 5S offers an upper deck to catch some rays or enjoy a meal in wrap-around seating at</span></p> \n<p><span style=\"font-size: 12pt;\">a high-low table. The tulip-shaped bow and round portlights deliver a distinctive retro look to the yacht, but she's fully loaded with modern engineering beneath her radiant skin.</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><strong><span style=\"text-decoration: underline;\">Key Features:</span></strong></span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-LED courtesy lights in gangways, steps and stern deck</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-6 person salon</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Cockpit upholstery PVC Diamante Snow</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Solid wood swim platform and retractable ladder with solid wood steps</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Alpi brushed Oak joinery for the interior</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Foldable table with &quot;Stonegrey&quot; leather panel in saloon</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Full-beam stateroom with double berth</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Sofa seats 4 to 6, upholstery &quot;Divine&quot; fabric and pillows</span></p> \n<p style=\"text-align: center;\"><span style=\"font-size: 12pt;\">-Electric windlass</span></p>",
